import React, { Component } from 'react';

class Clock extends Component {
  render() {
    return (
      <div className="col-4">
        <div className="tile">
          <div>December 4</div>
          <div class="tile-icon">
            <b>11:11 PM</b>
          </div>
          <div>Wednesday</div>
        </div>
      </div>
    );
  }
}

export default Clock;
